$(document).ready(function(){$("#startDateTimePicker").datepicker({daysOfWeekDisabled:[0,2,3,4,5,6],format:"dd/mm/yyyy"}).on("changeDate",function(){var n=moment($("#startDateTimePicker").datepicker("getDate")).format("YYYY-MM-DD");$("#startdatefilter").val(n);$(this).closest("form").submit()});$(".checktime").click(function(){var r=$(this).next().val(),n=$("#times").val()?$("#times").val().split(","):[],u=$(this).next().next().val(),f=parseInt($("#bill_Amount").val()),t=u*parseInt($("#hourprice").val()),i;this.checked?n.push(r):(i=n.indexOf(r),i>-1&&n.splice(i,1),t=-t);$("#times").val(n);$("#bill_Amount").val(f+t);$("#bill_Amount").trigger("change")});$(".print-btn").click(function(){return window.print(),!1});$(".bill-create").click(function(){return $("#times").val()==""?(alert("Need to select at least one time entry"),!1):!0});$("#bill_Number").change(function(){$("#number").val($(this).val())});$("#bill_Amount").change(function(){$("#amount").val($(this).val())});$("#bill_Date").change(function(){$("#date").val($(this).val())});$("#bill_Number").trigger("change");$("#bill_Amount").trigger("change");$("#bill_Date").trigger("change")});